import React, {useState,useEffect} from "react";
import style from "./Catalog.module.css"
import {Link, Route, Routes, useParams,} from "react-router-dom";
import {Contacts} from "./Contacts";
import {Deti} from "./Deti";
import {Givotny} from "./Givotny";
import {Pazly} from "./Pazly";
import {Konstruktory} from "./Konstruktory";
import {Interier} from "./Interier";
import {Mini} from "./Mini";
import {Suveniry} from "./Suveniry";

export const Catalog=()=>{

    const [zagolovok,setZagolovok]=useState("Товары");

    let arr=[
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/08/czif-1-300x300.jpg",
            name:"Игрушка развивающая «Сортер» Цифры",
            price:"7.50 BYN"
        },
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/08/fig-1-300x300.jpg",
            name:"Игрушка развивающая «Сортер» Геометрические фигуры",
            price:"7.50 BYN"
        },
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/08/rus-1-300x300.jpg",
            name:"Игрушка развивающая «Сортер» Алфавит русский",
            price:"10.00 BYN"
        },
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/08/angl-1-300x300.jpg",
            name:"Игрушка развивающая «Сортер» Алфавит английский",
            price:"7.50 BYN"
        },
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/07/1-300x300.jpg",
            name:"Игрушка развивающая Бизиборд — Трактор",
            price:"7.50 BYN"
        },
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/05/3-3-300x169.jpg",
            name:"«Кошкин дом» чёрый каркас — белый мех",
            price:"7.50 BYN"
        },
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/05/3-2-300x169.jpg",
            name:"«Кошкин дом» натуральный каркас — белый мех",
            price:"99.90 BYN"
        },
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/05/3-1-300x169.jpg",
            name:"«Кошкин дом» белый каркас — черный мех",
            price:"99.90 BYN"
        },
        {
            img:"https://eco-wood-art.by/wp-content/uploads/2022/05/3-300x169.jpg",
            name:"«Кошкин дом» белый каркас — розовый мех",
            price:"99.90 BYN"
        },
    ];

    let cart=arr.map(item=><div className={style.wrapper4}><img src={item.img} alt=""/>
         <h2>{item.name}</h2>
              <p>{item.price}</p>
         </div>);

const useEffect=(()=>{

    },[zagolovok])

    return(
        <div className={style.ddd}>
            <div className={style.naimenovanie}>
                <h1 className={style.zagolovok}>{zagolovok}</h1>
            </div>
           <div className={style.wrapper1}>
               <div className={style.wrapper2}>
                   <h1>Ктегории товаров</h1>
                   <ul className={style.category}>
                       <li onClick={(e)=>{setZagolovok(e.target.innerHTML)}}><Link to="/catalog/deti">Товары для детей</Link></li>
                       <li onClick={(e)=>{setZagolovok(e.target.innerHTML)}}><Link to="/catalog/givotny">Товары для животных</Link></li>
                       <li onClick={(e)=>{setZagolovok(e.target.innerHTML)}}><Link to="/catalog/pazly">Деревянные пазлы</Link></li>
                       <li onClick={(e)=>{setZagolovok(e.target.innerHTML)}}><Link to="/catalog/konstruktory">Механические конструкторы</Link></li>
                       <li onClick={(e)=>{setZagolovok(e.target.innerHTML)}}><Link to="/catalog/interier">Конструкторы для интерьера</Link></li>
                       <li onClick={(e)=>{setZagolovok(e.target.innerHTML)}}><Link to="/catalog/mini">Мини-конструкторы</Link></li>
                       <li onClick={(e)=>{setZagolovok(e.target.innerHTML)}}><Link to="/catalog/suveniry">Сувениры</Link></li>
                   </ul>
               </div>
               <div className={style.wrapper3}>
                   <Routes>
                       <Route path="/" element={cart}/>
                       <Route path="deti" element={<Deti/>}/>
                       <Route path="givotny" element={<Givotny/>}/>
                       <Route path="pazly" element={<Pazly/>}/>
                       <Route path="konstruktory" element={<Konstruktory/>}/>
                       <Route path="interier" element={<Interier/>}/>
                       <Route path="mini" element={<Mini/>}/>
                       <Route path="suveniry" element={<Suveniry/>}/>
                   </Routes>
               </div>
           </div>
        </div>
    )
}
